import React from "react";


function Services() {
  const services = [
    {
      title: "Corporate Law",
      description: "Advising companies on mergers, acquisitions, compliance, and corporate governance.",
      img: "/services/corporate.png"
    },
    {
      title: "Civil Litigation",
      description: "Representing clients in disputes including contracts, property, and civil rights.",
      img: "/services/civil.png"
    },
    {
      title: "Criminal Defense",
      description: "Defending clients in criminal proceedings with strategy and strong representation.",
      img: "/services/criminal.png"
    },
    {
      title: "Family Law",
      description: "Handling divorce, custody, adoption, and other family-related legal matters.",
      img: "/services/family.png"
    },
    {
      title: "Real Estate Law",
      description: "Assisting in property transactions, disputes, and legal compliance matters.",
      img: "/services/realestate.png"
    },
    {
      title: "Intellectual Property",
      description: "Protecting creative works, trademarks, patents, and copyrights for clients.",
      img: "/services/ip.png"
    }
  ];

  return (
    <div className="services-page">
      <h2>Our Legal Services</h2>
      <div className="services-grid">
        {services.map((service, index) => (
          <div key={index} className="service-box">
            <img src={service.img} alt={service.title} />
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
